import React from "react";
import "./Search.css";

export default function Search() {
  function handleSearch(event) {
    event.preventDefault();
  }
  return (
    <form>
      <input
        type="search"
        name="city"
        placeholder="search city"
        onChange={handleSearch}
      />
      <input type="button" value="search" />
    </form>
  );
}
